import React, { Component } from 'react';
import './ImageGrid.css';
import image1 from './Images/1.jpg';

class ImageGrid extends Component {
  render() {
    return (
      <div>
        <div className="container">

        	<div className="row">
			    <div class="col-md-12">
						<div class="card">
							<a href="https://github.com/albytho/Titanic-Machine-Learning-From-Disaster">
							<img class="card-img-top" src={image1} alt="Card image cap"/>
							</a>
							<h5 class="card-title">Titanic: Machine Learning from Disaster</h5>
							<div class="card-block">
								<p class="card-text">Artificial neural network that predicts how likely a person is to survive on the titanic based on their background.</p>
							</div>
						</div>
					</div>
        	</div>

        </div>
      </div>
    );
  }
}

export default ImageGrid;
